function storeReducer() {

  const dataStore = [
    {
      id: 1,
      name: 'canceled'
    },
    {
      id: 2,
      name: 'draft'
    },
    {
      id: 3,
      name: 'with pickup'
    },
    {
      id: 4,
      name: 'printed'
    }
  ]
  dataStore.map((item, index) => {
    return (
      <label className="item" key={index}>
        <input type="checkbox" />
        <span>{item.name}</span>
      </label>
    )
  })
}

export default storeReducer;
